import React from 'react';
import './Contatti.css';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';

const Contatti = () => {
  return (
    <div className="contatti-container">
      <h1>üìç Contatti e informazioni</h1>

      {/* Box Info */}
      <div className="box info">
        <p>üè¢ <strong>Indirizzo:</strong> Via Giorgio Washington 57, Milano, Italia</p>
        <p>üìû <strong>Telefono:</strong> +39 02-48193341</p>
        <p>üí¨ <strong>WhatsApp:</strong> +39 393 8883671</p>
        <p>üìß <strong>Email:</strong> <a href="mailto:info@rovighi.it">info@rovighi.it</a></p>
      </div>

      {/* Box Mappa */}
      <div className="box map-container">
        <MapContainer center={[45.4601, 9.1669]} zoom={13} scrollWheelZoom={false}>
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          <Marker position={[45.4601, 9.1669]}>
            <Popup>
              Via Giorgio Washington 57, Milano, Italia
            </Popup>
          </Marker>
        </MapContainer>
      </div>

      {/* Box Modulo Contatti */}
      <div className="box contact-form">
        <h2>‚úâÔ∏è Contattaci</h2>
        <form>
          <input type="text" placeholder="Nome" required />
          <input type="email" placeholder="Email" required />
          <textarea placeholder="Messaggio" required></textarea>
          <button type="submit">Invia</button>
        </form>
      </div>
    </div>
  );
};

export default Contatti;
